import React, { useState }  from 'react';
import './App.css';
import CreatureCard from './Components/CreatureCard'
import fish from './CreaturesJSON/FishJSON';
import bugs from './CreaturesJSON/BugsJSON';

const fishList = [...fish];
const bugList = [...bugs];


function App() {
this.state = {
  filter: true
}
  return (
    <div className="App">
      <div className="filters">
      <button
        id="riverFishFilter"
        onClick={this.setState.filter=!this.state.filter}> RIVER FILTER </button>
      </div>


      <div className="fish-container">
        {
          filteredFishList = () => {
            if (this.state.filter = false) {
              return 
          fishList.map(creature => (
          <CreatureCard
            name={creature.name}
            location={creature.location}
            price={creature.price}
          /> 

        ))}}}
      </div>

      <div className="bugs-container">
        {bugList.map(creature => (
          <CreatureCard
            name={creature.name}
            location={creature.location}
            price={creature.price}
          />
        ))}
      </div>
    </div>
  );
}


export default App;
